function setBar(key){var data={type:'bar',x:[],y:[],orientation:'h',marker:{color:[]},text:[],textposition:'outside',meta:[],hovertemplate:'%{meta}'+srcIndicatorOpt[key].label+': %{text}<extra></extra>',opacity:0.9};var tickers=[];Object.entries(srcTicker).forEach(([ticker,obj])=>{if((BARMODE&&(ticker.startsWith('W')&&ticker.includes('G')))||((!BARMODE)&&(ticker.startsWith('W')&&(!ticker.includes('G'))))){if(ticker!=='WS0000'){obj.ticker=ticker;tickers.push(obj);}}});tickers.sort((a,b)=>a[key]-b[key]).forEach(item=>{data.x.push(Math.abs(item[key]));data.y.push(item.name);data.marker.color.push(srcColors[item.ticker][key]);data.text.push(item[key]+srcIndicatorOpt[key].unit);data.meta.push(item.meta);});data.x=data.x.map(item=>item+0.3333*Math.max(...data.x));barLayout.annotations=data.y.map(item=>{return{x:0,y:item,xref:'x',yref:'y',text:item,showarrow:false,font:{family:fontFamily,color:'#ffffff',size:13,},xanchor:'left',yanchor:'middle'}})
barLayout.xaxis.range=[0,1.2*Math.max(...data.x)];Plotly.newPlot('plotly',[data],barLayout,barOption);}
function setMap(key){var data={type:'treemap',branchvalues:'total',labels:[],parents:[],values:[],text:[],meta:[],textposition:'middle center',textfont:{family:fontFamily,color:'#ffffff'},texttemplate:'%{label}<br>%{text}',marker:{colors:[],visible:true,},hovertemplate:'%{meta}<br>'+srcIndicatorOpt[key].label+': %{text}<extra></extra>',hoverlabel:{font:{family:fontFamily,color:'#ffffff'}},opacity:0.9,pathbar:{visible:true,}};Object.entries(srcTicker).forEach(([ticker,obj])=>{if(!SAMSUNG){if((ticker=='005930')||ticker.startsWith('W')){return}}else{if(ticker.startsWith('N')){return}}
data.labels.push(obj.name);data.parents.push(obj.ceiling);data.values.push(obj.size);if(obj[key]==null){data.text.push(srcIndicatorOpt[key].na);}else{data.text.push(obj[key]+srcIndicatorOpt[key].unit);}
data.meta.push(obj.meta);data.marker.colors.push(srcColors[ticker][key]);});Plotly.newPlot('plotly',[data],mapLayout,mapOption);}
function eventClickTreemap(item){var elements=$('g.slicetext');for(var n=0;n<elements.length;n++){if($(elements[n]).text().includes(item)){!$(elements[n]).get(0).dispatchEvent(EVE);return;}}}
$(document).ready(function(){setOption('.map-type',srcMapOpt,0);setOption('.map-option',srcIndicatorOpt,0);setSearchBar('.map-searchbar',srcTicker);setScaleBar('.map-legend',srcIndicatorOpt[$('.map-option').val()]);setMap($('.map-option').val());$('.map-type').on('change',function(){if(VIEW_MODE){BARMODE=!BARMODE;setBar($('.map-option').val());}else{SAMSUNG=!SAMSUNG;setSearchBar('.map-searchbar',srcTicker);setMap($('.map-option').val());}});$('.map-option').on('change',function(){setScaleBar('.map-legend',srcIndicatorOpt[$(this).val()]);if(VIEW_MODE){setBar($(this).val());}else{setMap($(this).val());}});$('.map-switch i').click(function(){VIEW_MODE=!VIEW_MODE;if(VIEW_MODE){var _index=BARMODE?0:1;setOption('.map-type',srcBarOpt,_index);setBar($('.map-option').val());$(this).removeClass('fa-signal').addClass('fa-map-o');$('.map-searchbar').prop('disabled',true);}else{var _index=SAMSUNG?0:1;setOption('.map-type',srcMapOpt,_index);setMap($('.map-option').val());$(this).removeClass('fa-map-o').addClass('fa-signal');$('.map-searchbar').prop('disabled',false);}});$('.map-reset').click(function(){VIEW_MODE=false;SAMSUNG=true;setOption('.map-type',srcMapOpt,0);setOption('.map-option',srcIndicatorOpt,0);setSearchBar('.map-searchbar',srcTicker);setScaleBar('.map-legend',srcIndicatorOpt[$('.map-option').val()]);setMap($('.map-option').val());});$('.map-searchbar').on('select2:select',function(e){const ticker=srcTicker[e.params.data.id];eventClickTreemap(ticker.ceiling);setTimeout(function(){eventClickTreemap(ticker.name);},1000);});$('#plotly').dblclick(function(){setMap($('.map-option').val());});$('#plotly').on('plotly_click',function(e,d){if(!VIEW_MODE){}})})